import { Row, Col, Image } from "react-bootstrap";
import products from "products";
import { RouteComponentProps } from "react-router";
import { RouteParams } from "pages/CardProduct/types";
import { ProductProps } from "pages/CardProduct/types";

const CardProduct = ({
	match,
	image,
	name,
}: RouteComponentProps<RouteParams>): any => {
	const product = products.filter((prod) => prod._vendorСode);

	console.log(product);

	return (
		<>
			<Header />

			{console.log(product)}
			<Row>
				<Col>
					<Image src={product.image} alt={product.name}></Image>
				</Col>
			</Row>
		</>
	);
};

export default CardProduct;
